import Expenses from "./components/Expenses";
import NewExpense from "./components/NewExpenses";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Cheese",
      amount: 94,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 700, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car",
      amount: 294,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "Desk",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];
  return(<div className="new-expense">
    <NewExpense />
    <Expenses expenses={expenses} /></div>);
}

export default App;
